import React, { useState } from 'react';
// import logo from './logo.svg';
import './App.css';

import Troy from 'text-exploder';

function App() {

  const [open, setOpen ] = useState('yippie')

  return (
    <div className="App" onClick={() => setOpen('true')}>

      <Troy open={open}/>
    </div>
  );
}

export default App;
